" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 533px\">",
"   <div class=\"ttl\">",
"    Five perspectives on body composition",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 513px; height: 332px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In this figure, the human body is classified into increasingly general categories, proceeding from the atomic level through molecular, cellular, tissue-system, and whole body. Each perspective is characterized by a set of unique components, which define its measurement parameters.",
"    <div class=\"footnotes\">",
"     ECS: extracellular solids; ECF: extracellular fluid.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Wang Z, Pierson RN, Heymsfield SB. The five-level model: a new approach to organizing body-composition research. Am J Clin Nutr 1992; 56:19.",
"    </div>",
"   </div>",
