var title_f22_36_23106="Apical 4 chamber carcinoid";
var content_f22_36_23106=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F82526&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F82526&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Carcinoid heart disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 252px; height: 382px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Four chamber views in systole (panel A) and diastole (panel B) show thickened and shortened tricuspid valve leaflets (TVL) and enlargement of the right atrium (RA) and ventricle (RV). Characteristically, the diseased tricuspid leaflets stay in a nearly fixed and open position regardless of phase of the the cardiac cycle. Thus, they are both stenotic, because they fail to open, and insufficient, because they fail to close. The degree of insufficiency almost always greatly exceeds the degree of stenosis.",
"    <div class=\"footnotes\">",
"     LV: left ventricle; LA: left atrium; MV: mitral valve.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
