"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        Moderately decreased GFR",
"       </td>",
"       <td>",
"        30 to 59",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4",
"       </td>",
